import "./NavBar.css"
import React from 'react';
import {FaTimes, FaBars} from "react-icons"

export const Navbar1 = () => {
  const state={clicked:false}
  return (
    <nav>
      <h1>React</h1>
        <ul className="list">
            <li className="items">SignIn</li>
            <li className="items">SignOut</li>
            <li className="items">Support</li>
        </ul>
        <button>
          <FaTimes/>
        </button>
    </nav>
  )
}
